import Vue from 'vue'
import Router from 'vue-router'

// routerの使用を宣言
Vue.use(Router)

// 遅延ローディング
const Login = () => import (/* webpackChunkName: "Login" */ "./components/pages/LoginPage.vue");
const Stamp = () => import (/* webpackChunkName: "Stamp" */ "./components/pages/StampPage.vue");

// mainで使用するためexportする
export default new Router({
    mode: "history",
    routes: [
        {
            path: "/login",
            component: Login

        },
        {
            path: "/stamp",
            component: Stamp
        }
    ]

})
